import React from "react";
import Job_Home from "../Job_Home/Job_Home";
import Navbar from "../../conponents/navbar/navbar";
import TopCompany from "../TopCompany/TopCompany";


function Home(){
    return(
        <div>
            <Navbar/>
            <TopCompany/>
            <Job_Home/>
        </div>
    );
}

export default Home;
